validation.regex:
{{
        (
          (isNewRow, currentIndex, currentRow) => (
      Utils.getRunValueRegex()
      ))
      (
        TableMedian.isAddRowInProgress,
        TableMedian.isAddRowInProgress ? -1 : TableMedian.editableCell.index,
        TableMedian.isAddRowInProgress ? TableMedian.newRow : (TableMedian.processedTableData[TableMedian.editableCell.index] ||
          Object.keys(TableMedian.processedTableData[0])
            .filter(key => ["__originalIndex__", "__primaryKey__"].indexOf(key) === -1)
            .reduce((prev, curr) => {
              prev[curr] = "";
              return prev;
            }, {}))
      )
    }}

